import React, { Component } from "react";

export class SearchResults extends Component {
  constructor(props) {
    super(props);
    this.state = {
      searchResults: []
    };
  }

  componentDidMount() {
    fetch(
      `https://api.themoviedb.org/3/search/multi?api_key=170638d59cd41f58852a2f12564d2503&language=en-US&query=SEARCH%20GOES%20HERE&page=1&include_adult=false`
    ).then(data => console.log(data));
  }

  render() {
    return (
      <div className="container text-white py-4 text-center">
        <h1>Search Results for {this.props.location.search}</h1>
      </div>
    );
  }
}

export default SearchResults;
